import axios from "axios";

const bingoService = (() => {
  const getNewCard = async () => {
    return await axios.get(`${process.env.BACKEND_URL}/bingo`);
  };
  const getNewNumbers = async () => {
    return await axios.post(`${process.env.BACKEND_URL}/bingo`, {});
  };

  return {
    getNewCard,
    getNewNumbers,
  };
})();
export default bingoService;
